import React from "react";
import Home from "./componants/Home";
import { Routes, Route } from "react-router-dom";
import { GlobalContextProvider } from "./context";

function App() {

  return (
    <>
    <GlobalContextProvider>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </GlobalContextProvider>
    </>
  );
}

export default App;
